DROP TABLE TAB_IMPORTACAO;
CREATE TABLE TAB_IMPORTACAO (ID_IMPORTACAO int NOT NULL AUTO_INCREMENT, ID_USUARIO int NOT NULL, DATA_IMPORTACAO timestamp DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP, QTDE_REGISTRO mediumint NOT NULL, STATUS varchar(15) NOT NULL, MSG varchar(250), ID_OPERACAO varchar(25) NOT NULL, PRIMARY KEY (ID_IMPORTACAO), INDEX fk_TAB_IMPORTACAO_TAB_USUARIO1_idx (ID_USUARIO)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TAB_PLANILHA;
CREATE TABLE TAB_PLANILHA (ID_PLANILHA int NOT NULL AUTO_INCREMENT, ID_USUARIO int NOT NULL, ID_OPERACAO varchar(25) NOT NULL, PATOLOGIA varchar(30) NOT NULL, FAIXA_ETARIA varchar(6) NOT NULL, SEXO varchar(1) NOT NULL, QTDE_D mediumint DEFAULT '0' NOT NULL, QTDE_S mediumint DEFAULT '0' NOT NULL, QTDE_N mediumint DEFAULT '0' NOT NULL, QTDE_T mediumint DEFAULT '0' NOT NULL, QTDE_H mediumint DEFAULT '0' NOT NULL, DATA timestamp DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP, PRIMARY KEY (ID_PLANILHA), INDEX FK_ID_IMPORTACAO_IDX (ID_USUARIO)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TAB_USUARIO;
CREATE TABLE TAB_USUARIO (ID_USUARIO int NOT NULL AUTO_INCREMENT, RAZAO varchar(50) NOT NULL, CNPJ char(20) NOT NULL, FONE char(20), RESPONSAVEL varchar(50) NOT NULL, EMAIL varchar(50) NOT NULL, SENHA char(20) NOT NULL, DATA_CADASTRO timestamp DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP, STATUS enum('A','I') DEFAULT 'A' NOT NULL, PRIVILEGIO enum('A','U') DEFAULT 'A' NOT NULL, REGISTRO enum('A','I'), PRIMARY KEY (ID_USUARIO)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
ALTER TABLE TAB_IMPORTACAO ADD CONSTRAINT FK_ID_USUARIO FOREIGN KEY (ID_USUARIO) REFERENCES TAB_USUARIO (ID_USUARIO) ON DELETE NO ACTION ON UPDATE NO ACTION;
